import React from 'react';
import { Link } from 'react-router-dom';

const UserItem = (props:any) => {

    const {user} = props;
    return (
        <Link to={`/user/${user.username}`} className='list-group-item list-group-item-action'>{user.username}</Link>
    );
};

export default UserItem;
